-- ----------------------------
-- Function structure for stringLike
-- ----------------------------
DROP FUNCTION IF EXISTS `stringLike`;
delimiter ;;
CREATE FUNCTION `stringLike`(s VARCHAR(6), p VARCHAR(6))
 RETURNS double
BEGIN
	#Routine body goes here...
	DECLARE sum DOUBLE DEFAULT 0;
	DECLARE i INT DEFAULT 1;
	WHILE i <= 6 DO
		if SUBSTR(s, i, 1)=SUBSTR(p, i, 1) THEN
			SET sum = sum + 1;
		END IF;
		SET i = i + 1;
	END WHILE;
	RETURN sum/6;
END
;;
delimiter ;

SET FOREIGN_KEY_CHECKS = 1;
